importScripts('js/serviceworker-cache-polyfill.js');


self.addEventListener('install', function(e) {
 e.waitUntil(
   caches.open('Palmerston_Parks').then(function(cache) {
     return cache.addAll([
       '/',
       '/index.html',

       'css/main.css',
       'js/main.min.js'
     ]);
   })
 );
});
